text:
celebrating our 5th annual thanksgiving lunch with the amazing women from the trans latin@ group! it was a very meaningful dinner full of positive vibes and lots of positive  hope for the future. i’m very grateful with virginia munoz and david colon from florida health department for sharing this especial moment with us and for always caring about the health and well-being of the latinx trans community in miami dade. 
celebramos el pasado jueves la noche de accion de garcias con las mujeres maravillosas del grupo trans latin@. este quinto año de celebración y de dar gracias por lo recibido este año fue muy hermoso. estuvo lleno de energía positiva y de mucha fe por un mejor futuro. muy agradecido con el equipo de departamento de salud de miami quienes compartieron esta hermosa cena con nosotros y además hicieron pruebas std’s. ❤️❤️❤️🙏
@florida.health @survivorspathwayorganization @miamidadehaab #survivorspathway #metoo #humanrights #nomore #domesticviolence #lgbt #lgbtq #transgender #translatina

